export default function ChartCard({ title }) {
  return (
    <div className="card chart-card">
      <h4>{title}</h4>
      <div className="chart-placeholder">
        Chart Placeholder
      </div>
    </div>
  );
}
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  ArcElement,
  Tooltip,
  Legend,
} from "chart.js";

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  LineElement,
  PointElement,
  ArcElement,
  Tooltip,
  Legend
);
